function App() {
  return (
      <div className="min-h-screen bg-gray-100 flex flex-col">
        <Header />
        <main className="flex-grow">
          <Hero />
          <div className="container mx-auto px-4 py-8 md:py-12">
            <div className="grid gap-8 md:grid-cols-2">
              <Announcements />
              <Events />cd
            </div>
            <div className="mt-12">
              <SchoolDashboard />
            </div>
          </div>
        </main>
        <Footer />
      </div>
    );
  }

export default App;
